import React, { Component } from "react";

export default class RiskHeader extends Component {
    constructor(props){
        super(props);
        this.state={
            CategoryName:'abcd'
        }
    }
  render() {
    return (
      <React.Fragment>
        <div className="riskTypeBar noRisk">
    <span>{this.state.CategoryName}</span>
        </div>
      </React.Fragment>
    );
  }
}
